import React from "react";
import Table from "./Table";

export default function MainWindow(props) {
  const title = props.title,
    items = props.items;
    
  return (
    <section>
      {console.log(props.likes)}
  
      <h2>{title}</h2>
      <div className="items_list">
        {items
          ? items.map((item, key) => (
              <Table
                item={item}
                key={key}
                like={(like_data,id) => {
                  props.like(like_data,id);
                }}
                openItem={(selected_item) => {
                  props.openItem(selected_item);
                }}
              />
            ))
          : console.log("loading")}
      </div>
    </section>
  );
}
